import React from 'react'
import './AboutSite.css'
import { withRouter } from 'react-router-dom'
import {Card,Row,Divider,Timeline} from 'antd'
import { ClockCircleOutlined } from '@ant-design/icons';
import BlogCommonBackGround from '../../components/blog/BlogCommonBackGround'

/**
 * 关于本站的基本操作
 */
class AboutSite extends React.Component{

    constructor(props){
        super(props)
        this.state={

        }

    }

    render(){

        return(
            <BlogCommonBackGround
            left={
                <Card>ceshio </Card>
            }

            extra={
                <Card
                title={"关于本站"}
                extra={""}
                >
                    <Row className="about-site-row">
                        <h3>本站简介</h3>
                        <p>
                            首先欢迎访问我的个人博客，日常杂论，分享平时生活中的有趣，有意义的事情，
                            不定期的分享图片或者读书的文章，以及学习的技术和工作中遇到的问题。
                        </p>
                    </Row>
                    <Divider dashed/>
                    <Row className="about-site-row">
                        <h3>网站时间线</h3>
                        <p>
                        <Timeline mode="alternate">
                            <Timeline.Item
                            label={"2020年3月"}
                            >
                                用react重新构建我的博客网站
                            </Timeline.Item>
                            <Timeline.Item 
                            label={"2020年1月"}
                            color="green">
                                修改网站的已知的BUG.
                            </Timeline.Item>
                            <Timeline.Item 
                            label={"2019年"}
                            dot={<ClockCircleOutlined style={{ fontSize: '16px' }} />}>
                                网站改版，改变网站的主题，修改为藏青色，增加站主笔记模块，论坛模块，淘宝优惠卷模块,系统集成markdown编辑器
                            </Timeline.Item>
                            <Timeline.Item 
                            label={"2018年"}
                            color="red">
                                虽然网站的外表没有什么改进，但是底层的技术支持换成了spring-boot+mybatis+redis and the like
                            </Timeline.Item>
                            <Timeline.Item
                            label={"2017年"}
                            >
                                网站原型搭建成功，与11月部署在阿里云服务器上
                            </Timeline.Item>
                            <Timeline.Item 
                            dot={<ClockCircleOutlined style={{ fontSize: '16px' }} />}
                             label="lang lang ago">
                            那是一个遥远的故事，欲知详情，请联系作者！！！😄
                            </Timeline.Item>
                        </Timeline>
                        </p>
                    </Row>
                    <Divider dashed/>
                    <Row className="about-site-row">
                        <h3>博客资源</h3>
                        <p>
                           <Card
                           bordered={false}
                           title={<span style={{fontSize:"14px"}}>网站设计图</span>}
                           cover={<img src={"http://file.breakpoint.vip/picture/microp/banner1.jpg"}/>}
                           >
                                <Card.Meta
                                title={"网站设计图"}
                                description={"最初的网站设计"}
                                />
                           </Card>
                        </p>
                        <p>

                        </p>
                    </Row>
                    <Divider dashed/>


                </Card>
            }
            />
        )
    }

}

export default withRouter(AboutSite)
